import './App.css';
import Nav from './nav.js';
import PopularRecipies from './popularRecipies.js';

const appId = 'ead485a5';
const appKey = 'f98088fb968d25b71925fd7a89467acc';

const fetchData = async () => {
  const apiUrl = 'https://api.edamam.com/api/food-database/v2/parser?...';
  
  try {
    const response = await fetch(`${apiUrl}?app_id=${appId}&app_key=${appKey}`);
    
    if (!response.ok) {
      throw new Error(`HTTP error! Status: ${response.status}`);
    }

    const data = await response.json();
    
    // Handle the API response
    console.log(data);
  } catch (error) {
    console.error('Error fetching data:', error.message);
  }
};

// Call the function to fetch data
fetchData();



function App() {
  return (
    
    <div className="App md:overflow-visible overflow-hidden">
      <Nav style={{ zIndex: '999' }} />
      <PopularRecipies />
    </div>

  );
}

export default App;
